class Solution:
    def numberOfBeautifulIntegers(self, low: int, high: int, k: int) -> int:
        def countDigits(n):
            even = odd = 0
            while n:
                digit = n % 10
                if digit % 2 == 0:
                    even += 1
                else:
                    odd += 1
                n //= 10
            return even, odd

        def isBeautiful(n):
            even, odd = countDigits(n)
            return even == odd and n % k == 0

        count = 0
        # Optimize by starting from the lowest multiple of k greater than or equal to low
        start = low + (k - low % k) % k
        for i in range(start, high + 1, k):
            if isBeautiful(i):
                count += 1
        return count
